import React from "react";
import Cincinnati from "../img/footer-img/Cincinnati_logo.jpg";
import CBell from "../img/footer-img/CincinnatiBell_logo.png";
const Footer = () => (
    <div className="Footer">
       <div className="sponsors">
           <img alt='' src={Cincinnati}/> <p>Cincinnati_logo</p>
           <img alt='' src={Cbell}/> <p>Cincinnati bell logo</p>
           <img alt='' src="../img/footer-img/fifth_third_bank.jpg"/><p>Fifth third bank</p> 
           <img alt='' src="../img/footer-img/Macy's logo.jpg"/><p>Macy</p> 
           <img alt='' src="../img/footer-img/P&G.png"/> <p>P&G</p>

      
        </div>

    
       <div className="Creators">
        <p>Lauren Moore</p>
        <p>Mona Jira</p>
        <p>Marquis Jarman</p>
        <p>We devoted our times and hearts to create this content of our beloved city.
         Hope you guys find it is useful infomation when you travel in our hometown. Let us know</p>

            



        </div>
    </div>
  );
  


export default Footer;
